import React from "react"
import { useParams } from "react-router"
import Navbar from "../common/navbar"
import ResponsiveRow from "../common/responsiveRow"
import StoreButton, { RightArrow } from "../common/storeButton"
import NotFoundPage from "../notFound/notFoundPage"
import ProductCard, { TestProduct } from "../products/productCard"

const ProductDetailPage = props => {
    const params = useParams()

    if (!params.id) {
        return <NotFoundPage />
    }

    const prod = TestProduct

    return (
        <div>
            <Navbar/>
            <NavBreadcrumb/>
            <div>
                <h4>Related products</h4>
                <StoreButton variant="secondary">
                    {"More products "}
                    <RightArrow />
                </StoreButton>
            </div>
            <ResponsiveRow>
                <ProductCard
                    border={false}
                    product={TestProduct}
                />
